import axios from 'axios';

const SERVER_URL_BASE = "";

export async function postAccessoryData (placement, subType, aData) {
    const url = `/api/accessory/create`;
    const devUrl = "http://localhost:3000/accessory/create";
    if (window.confirm(`Are you sure you eant to save this accessory as sub type ${subType} and placement ${placement}`)) {
       const response = await axios.post(devUrl, {
           headers: {
               'Content-Type': 'application/json',
           },
           data: {
               placement: placement,
               subType: subType,
               accessory: aData
           }
       });
        console.log("create kat accessory response", response.status);
    }
}

export async function getKatData () {
    const url = `/api/generate/kat`;
    const devUrl = "http://localhost:3000/generate/kat";
    const response = await axios.get(devUrl);
    console.log("generate cat response status", response.status);
    return response.data;
}

export async function getAccessory (placement) {
    console.log('dao ga', placement);
    const url = `/api/accessory/${placement}`;
    const devUrl = `http://localhost:3000/accessory/${placement}`;
    const response = await axios.get(devUrl);
    console.log("get accessory response status", response.status);
    return response.data;
}

export async function getPalette (type) {
    const url = `/api/palette/${type}`;
    const devUrl = `http://localhost:3000/palette/${type}`;
    const response = await axios.get(devUrl);
    console.log("get palette response status", response.status);
    return response.data;
}
